import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";
const ProductList=()=>{
    const[products,setProducts]=useState([])
    useEffect(() => {
        axios.get('http://localhost:3001/product')  // This URL should match your backend
          .then(res => {
            console.log('Received products:', res.data);  // 
            setProducts(res.data);  // Set the products to state
          })
          .catch(err => {
            console.error('Failed to fetch products:', err);  // Log errors
          });
      }, []);
      
    return(
        <div className="p-10">
        <h1 className="text-3xl font-bold mb-6">Products</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {products.map(product => (
            <div key={product.id} className="border rounded-lg p-4 shadow">
              <img src={product.image_url} alt={product.name} className="w-full h-48 object-cover mb-2" />
              <h2 className="text-xl font-semibold">{product.name}</h2>
              <p className="text-gray-600">{product.description}</p>
              <p className="text-blue-600 font-bold mt-2">${product.price}</p>
            </div>
          ))}
        </div>
      </div>
    )
}
export default ProductList
